sys_variable_value.value:
(function execute(inputs, outputs) {
 var fielddetails =  new GlideRecord('x_1107692_banking_accountant');
 fielddetails.get(inputs.sysid);
 fielddetails.setValue(inputs.fieldnameforVerification, inputs.fieldvalueforVerification);
 fielddetails.setValue(inputs.fieldnameforApproval, inputs.fieldvalueforApproval);
 fielddetails.update();

})(inputs, outputs);

